import './App.css';
import { NavBar } from './components/NavBar';
import { Banner } from './components/Banner';
import { Skills } from './components/Skills';
import { Projects } from './components/Projects';
import { Contact } from './components/Contact';
import { Footer } from './components/Footer';
import { ProjectsScreen } from './components/ProjectsScreen'; // Import the new ProjectsScreen component
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Import routing

function App() {
  return (
    <Router>
      <div className="App">
        <NavBar />
        <Routes>
          <Route path="/" element={
            <>
              <Banner />
              <Skills />
              <Projects />
              <Contact />
            </>
          } />
          {/* Add route for the ProjectsScreen */}
          <Route path="/projects-screen" element={<ProjectsScreen />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
